import Posts from "../../components/posts/Posts";
import Share from "../../components/share/Share";
import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "./home.scss";

const Home = () => {
  return (
    <div className="home">
      <Share />
      <Posts />
    </div>
  );
};

export default Home;
